import React from "react";
const fred = "https://images.amcnetworks.com/ifc.com/wp-content/uploads/2010/12/Portlandia_S7_Fred-amore-headshot.jpg";


const images = [
        '../src/assets/blue.png',
        '../src/assets/pink.jpg',
        '../src/assets/plain.png',
        '../src/assets/rasberry.png',
        '../src/assets/sugar.png'
        ];

function Card(props) {
    return images.map((item) => (
        <div
            className="card"
            key={item.i}
            style={{backgroundImage: `url(${fred})`}}
        >
        </div>
    ));
}

export default Card;
